import React, {Component} from 'react';
import './App.scss';
import Router from "./modules/router/Router";
import Notify from "./commons/notify/Notify";
import {observer} from 'mobx-react';
import store from './commons/services/BaseService';

@observer
class App extends Component {

    constructor(props: any) {
        super(props);
        try {
            if (window.location.pathname === '/')
                window.location.href = '/register';
        } catch (e) {
            console.error(e);
        }
    }

    render() {
        return (
            <div style={{position: 'relative', zIndex: 1, overflowX: 'hidden'}}>
                <div
                    className={'animation-push-mes'}
                    style={{
                        position: 'absolute',
                        top: '5%',
                        right: `${store.statusPushMes ? '1' : '-25'}%`,
                        // transform: `translateX(${store.statusPushMes? '-125' : '0'}%)`,
                        zIndex: 1000,
                    }}
                >
                    {Notify(store.type, store.mes)}
                </div>
                <Router/>
            </div>
        );
    }
}

export default App;
